Actionscript.script:
_parent.UpdateBigSmallState("普攻中","空手一段中");
_parent.攻击呐喊();
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      if(Key.isDown(_root.右键) == true)
      {
         _parent.移动("右",快速度);
      }
      else
      {
         _parent.移动("右",慢速度);
      }
   }
   else if(_parent.方向 == "左")
   {
      if(Key.isDown(_root.左键) == true)
      {
         _parent.移动("左",快速度);
      }
      else
      {
         _parent.移动("左",慢速度);
      }
   }
}

_parent.UpdateBigSmallState("普攻中","空手二段中");
_parent.攻击呐喊();
if(Key.isDown(_parent.左键))
{
   _parent.方向改变("左");
}
if(Key.isDown(_parent.右键))
{
   _parent.方向改变("右");
}

