onClipEvent(enterFrame){
   if(_parent._parent.操控编号 != -1 and _root.控制目标全自动 == false)
   {
      if(Key.isDown(_parent._parent.A键) == true)
      {
         _parent.gotoAndPlay("2连招");
      }
      else if(Key.isDown(_parent._parent.左键) == true or Key.isDown(_parent._parent.右键) == true or Key.isDown(_parent._parent.上键) == true or Key.isDown(_parent._parent.下键) == true)
      {
         _parent._parent.动画完毕();
      }
   }
   else
   {
      _parent.gotoAndPlay("2连招");
   }
}

